import styled from 'styled-components';
import { ReactComponent as CartLogo } from '../../../public/cart-icon.svg';

export const EmptyCartContainer = styled.div`
  position: absolute;
  width: 360px;
  height: 480px;
  margin-left: 120px;
  margin-top: 128px;

  background: #FFFFFF;
`

export const CartLogoComponent = styled(CartLogo)`
  position: absolute;
  margin-left: 154px;
  margin-top: 170px;
`

export const EmptyTitle = styled.p`
  position: absolute;
  width: 185px;
  height: 32px;
  left: 88px;
  top: 232px;

  font-family: Open Sans;
  font-style: normal;
  font-weight: 600;
  font-size: 21px;
  line-height: 32px;

  text-align: center;
  color: #333333;
`

export const EmptySubtitle = styled.p`
  position: absolute;
  width: 227px;
  height: 48px;
  left: 67px;
  top: 272px;

  font-family: Open Sans;
  font-style: normal;
  font-weight: normal;
  font-size: 16px;
  line-height: 24px;

  text-align: center;
  color: #333333;
`

export const MatchedItems = styled.div`
  position: absolute;
  display: flex;
  flex-direction: column;
  justify-content: space-between;
  width: 360px;
  height: 480px;
  margin-left: 120px;
  margin-top: 128px;

  background: #FFFFFF;
`

export const MatchedItem = styled.div`  
  position: absolute;
  width: 360px;
  height: 106px;
  left: 0px;
  top: 0px;

  border-bottom: 1px solid #DDDDDD;
`

export const ImageItem = styled.img`
  background-image: url('/yogurt.png')
  height: 80px;
  width: 74px;
  margin-top: 16px;
  margin-left: 16px;
`
